package com.siims.szb.order.wrapper;

public class OrderWrapper {

	private String goodsIdString;
	
	private String goodsconfigIdString;
	
	private String shopidString;
	
	private String priceString;
	
	private String paytypeString;
	
	private String numString;
		
	public OrderWrapper() {
		// TODO Auto-generated constructor stub
	}

	public String getGoodsIdString() {
		return goodsIdString;
	}

	public void setGoodsIdString(String goodsIdString) {
		this.goodsIdString = goodsIdString;
	}

	public String getGoodsconfigIdString() {
		return goodsconfigIdString;
	}

	public void setGoodsconfigIdString(String goodsconfigIdString) {
		this.goodsconfigIdString = goodsconfigIdString;
	}

	public String getShopidString() {
		return shopidString;
	}

	public void setShopidString(String shopidString) {
		this.shopidString = shopidString;
	}

	public String getPriceString() {
		return priceString;
	}

	public void setPriceString(String priceString) {
		this.priceString = priceString;
	}

	public String getPaytypeString() {
		return paytypeString;
	}

	public void setPaytypeString(String paytypeString) {
		this.paytypeString = paytypeString;
	}

	public String getNumString() {
		return numString;
	}

	public void setNumString(String numString) {
		this.numString = numString;
	}


}
